value:
(
  property: SimplifiedSchemaProperty
): string => {
  const requiredString = property.required ? "" : "(optional)";

  const descriptionString = noNewlines(property.schema.description) || "";

  // TODO: stack deeper objects and make sure to also print tables for those
  return `| ${property.name} ${requiredString} | ${property.schema.type} | ${descriptionString} |`;
}
